import Modal from "react-bootstrap/Modal";
import styled from "styled-components";

export const ModalBody = styled(Modal.Body)`
    height: 300px;
    font-size:10px;
    overflow-y: scroll;
`

export const ModalFooter = styled(Modal.Footer)`
    width: 100%;
    font-size:25px;
    margin: 0 auto;
`
